package remove_all_adjacent_duplicates_in_string_ii

import "testing"

func Test_removeDuplicates(t *testing.T) {
	t.Log(removeDuplicates("abcd", 2))
	t.Log(removeDuplicates("deeedbbcccbdaa", 3))
	t.Log(removeDuplicates("pbbcggttciiippooaais", 2))
	t.Log(removeDuplicates("", 1000))
}

func Test_f2(t *testing.T) {
	t.Log(f2("abcd", 2))
	t.Log(f2("deeedbbcccbdaa", 3))
	t.Log(f2("pbbcggttciiippooaais", 2))
	t.Log(f2("", 1000))
}
